import React from 'react';
import BarChart from './BarChart.js'

export default class Welcome extends React.Component{
	render(){
		return(		
			<Container>
				<Row>
					<Col>
						<Card>
						<Card.Title>Neo Life Boutique Sales Data Report</Card.Title>
						</Card>
					</Col>
				</Row>
				<Row>
					<Col><BarChart/></Col>
					<Col><BarChart/></Col>
				</Row>
            </Container>

		);
	}
}
